import React,{Component}from 'react';
import {View, StyleSheet,TextInput, Text, TouchableOpacity,ScrollView, Image} from 'react-native';

;import Icon from 'react-native-vector-icons/Ionicons';



export default class forgot extends Component{
    constructor(props){
        super(props)
        this.state={
           
        }
    }
     
    render(){ 
        
    
        
     
    
        return(
<ScrollView>
        <View  style={{backgroundColor: '#adf6d6',flex:1,justifyContent: 'center',alignItems: 'center'}}>
     
        <TouchableOpacity
            onPress={() => this.props.navigation.navigate('Login')}
            >
        <Image
            source={require('../../../../assets/TripLogo.png')}
            resizeMode="center"
            style={  {
    
                resizeMode: 'contain',
                width: 50,
                height: 50,
                marginTop:5
             
            }}
          />
          </TouchableOpacity>
        <TouchableOpacity onPress={()=>this.props.navigation.navigate('Sultanahmet')} style={{position:'absolute',right:'85%',top:0}}>
    <Icon  name={Platform.OS === "ios" ? "ios-add" : "arrow-back-circle-outline"}
  //name={(this.state.hidePassword)?"eye-off-outlane:eye-outlane"}  şifre görünürlüğü açıp kapatma
  color="black"
  size={55}/>
</TouchableOpacity>
        <View style={{alignItems:'center'}}> 
   <Text style={{color:'black',fontSize:30,alignItems:'center',justifyContent:'center'}}>
Sultanahmet Mosque
     </Text>
     </View>
         <Text style={{margin:25,fontSize:25,color:'black'}}>
             
             
         Sultan Ahmed Mosque (Turkish: Sultan Ahmet Camii), also known as the Blue Mosque, is an Ottoman-era historical imperial mosque located in Istanbul, Turkey. A functioning mosque, it also attracts large numbers of tourist visitors. It was constructed between 1609 and 1616 during the rule of Ahmed I. Its Külliye contains Ahmed's tomb, a madrasah and a hospice. Hand-painted blue tiles adorn the mosque’s interior walls, and at night the mosque is bathed in blue as lights frame the mosque’s five main domes, six minarets and eight secondary domes.[2] It sits next to the Hagia Sophia, the principal mosque of Istanbul until the Blue Mosque's construction and another popular tourist site. The Blue Mosque was included in the UNESCO World Heritage Site list in 1985 under the name of "Historic Areas of Istanbul".
         </Text>
         </View>
         
        </ScrollView>
        
        )
      
    }
    
}
